import React, { useState } from 'react';
import './Dashboard.css';
import dwi from '../Assets/dw.png';
const Dashboard = () => {

    const queryParams = new URLSearchParams(window.location.search);
    const Username = queryParams.get('Username');
    const [showImage, setShowImage] = useState(false);
    const [bold, setBold] = useState({
        fontWeight: 'normal'
    })

    const handleShowO = () => {
        setShowImage(true);
        setBold({ fontWeight: 'bold' });
    };
    const handleShowL = () => {
        setShowImage(false);
        setBold({ fontWeight: 'normal' });
    };
    const [ImageStyle, setImageStyle] = useState({
        height: '25px',
        width: '25px',
        filter: 'invert(1)'
    });


    const imagehandleO = () => {
        setImageStyle({
            // paddingTop: '-20px',
            height: '34px',
            width: '34px',
            filter: 'invert(1)'
        });
    }
    const imagehandleL = () => {
        setImageStyle({

            height: '25px',
            width: '25px',
            filter: 'invert(1)'
        });

    }
    const [hambfunc, sethambfunc] = useState(false);

    const ham = () => {
      sethambfunc(true)
    };

    return (

        <div className='main'>
            <div className="left">
                <div onMouseEnter={handleShowO} onMouseLeave={handleShowL} className="lists account">
                    <span onMouseEnter={handleShowO} onMouseLeave={handleShowL} style={bold} >@{Username}</span>
                    {showImage && (
                        <div>

                            <img onClick={ham} onMouseEnter={imagehandleO} onMouseLeave={imagehandleL} class='imi' src={dwi} style={ImageStyle} alt="image" />

                        </div>

                    )}
                    {hambfunc && (
                        <div>
                            <div className="logout">

                            </div>
                            <div className="updateprofile">

                            </div>


                        </div>
                    )}
                    <div className="lists dashboard">
                    </div>
                    <div className="lists reports">
                    </div>
                    <div className="lists settings">
                    </div>
                    <div className="footer">
                        <div className="letschat">
                        </div>
                        <div className="collapse_menu">
                        </div>
                    </div>
                </div>
                <div className="right">
                </div>
            </div>
            </div>
            );
}
            export default Dashboard
